import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function BasicTextFields() {
    const inputProps = {
        step: 300,
      };

  return (
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 0, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
      <TextField id="filled-basic" defaultValue="Normal" label="Filled" variant="filled" inputProps={inputProps} />
    </Box>
  );
}
